// ProductRenderSection.js shows off the renderd production interface of the KubeChain platform. It is a simple component that displays a title and a paragraph of text. The UserExperienceSection.js component is similar, but it is a bit more complex. It has a title and a paragraph of text, but it also has a background color and a different font size. The AboutSection.js component is also similar, but it has a different background color and a different font size. The Header.js component is a bit more complex. It has a navigation bar with links to different sections of the page. The App.js file is the main file that renders all of the components. It is a bit more complex because it has a lot of components and it has a navigation bar that is rendered on every page.
// import the assets 
import React from 'react';
import styled from 'styled-components';
import { Link } from 'react-scroll';
// ../assets/multidashboard.png
import multiDash from '../assets/multidashboard.png'; // Ensure the path matches your file structure
// multidash2kubechain
import multiDash2 from '../assets/multidash2kubechain.png'; // Ensure the path matches your file structure
// multidash5kubechain
import multiDash5 from '../assets/multidash5kubechain.png'; // Ensure the path matches your file structure

const ProductContainer = styled.section`
    padding: 4rem 2rem;
    background-color: #f4f4f4;
    color: #333;
    `;
const ProductTitle = styled.h2`
    font-size: 2.5rem;
    text-align: center;
    margin-bottom: 1rem;
    `;
const ProductText = styled.p`
    max-width: 800px;
    margin: auto;
    margin-bottom: 3rem;
    line-height: 1.6;
    text-align: center;
    `;
const ProductImage = styled.img`
    width: 100%;
    height: auto;
    margin-bottom: 3rem;
    `;
const ProductRenderSection = () => (
    <ProductContainer>
        <ProductTitle>Product Render</ProductTitle>
        <ProductText>
            KubeChain is a decentralized cloud computing platform that enables users to deploy and manage applications on a global network of nodes. Our platform is designed to provide a seamless and intuitive user experience, allowing developers to focus on building and scaling their applications without the complexity of traditional cloud infrastructure.
        </ProductText>
        <ProductImage src={multiDash} alt="multiDash" />
        <ProductImage src={multiDash2} alt="multiDash2" />
        <ProductImage src={multiDash5} alt="multiDash5" />
    </ProductContainer>
);

export default ProductRenderSection;
